import { BrowserRouter as Router } from "react-router-dom";
import Navbar from "./components/Navbar";

function App() {
  return (
    <Router>
      <Navbar />
      <p style={{ marginTop: "100px" }}>App content</p>
    </Router>
  );
}

export default App;
